import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Home() {
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    Axios.get('http://127.0.0.1:8000/api/vehicles/')
      .then((response) => {
        setVehicles(response.data);
      })
      .catch((error) => {
        console.error('Error fetching vehicle data:', error);
      });
  }, []);

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary">
        <Container fluid>
          <Navbar.Brand href="http://localhost:3000">VehicleVerse</Navbar.Brand>
          <Navbar.Toggle aria-controls="vehicleerse" />
          <Navbar.Collapse id="vehicleverse">
            <Nav
              className="me-auto my-2 my-lg-0"
              style={{ maxHeight: '100px' }}
              vehicleverse
            >
              <Nav.Link href="http://localhost:3000">Home</Nav.Link>
              <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
              <NavDropdown title="POST" id="navbarScrollingDropdown">
                <NavDropdown.Item href="http://localhost:3000">ADD For Sell</NavDropdown.Item>
                <NavDropdown.Item href="http://localhost:3000">ADD For Rent</NavDropdown.Item>
              </NavDropdown>
              <Nav.Link href="http://localhost:3000/profile">Profile</Nav.Link>
            </Nav>
            <Form className="d-flex">
              <Form.Control
                type="search"
                placeholder="Search"
                className="me-2"
                aria-label="Search"
              />
              <Button variant="outline-success">Search</Button>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <Container className="mt-4">
        <h1 className="text-center">Vehicle Listings</h1>
        {vehicles.map((vehicle) => (
          <Card key={vehicle.id} className="mb-4">
            <Card.Img
              src={vehicle.image_link}
              alt="Vehicle"
              style={{ height: '400px' }}
            />
            <Card.Body>
              <Card.Title>Vehicle Type: {vehicle.vehicle_type}</Card.Title>
              <Card.Text>Make: {vehicle.make}</Card.Text>
              <Card.Text>Model: {vehicle.model}</Card.Text>
              <Card.Text>Year: {vehicle.year}</Card.Text>
              <Card.Text>Phone Number: {vehicle.phone_number}</Card.Text>
              <Card.Text>Price: {vehicle.price}</Card.Text>
              <Card.Text>Description: {vehicle.description}</Card.Text>
            </Card.Body>
          </Card>
        ))}
      </Container>
    </div>
  );
}

export default Home;
